import React from 'react'

const textInfor=[
    {text1:"we provide"},
    {text2:"visual coding"},
    {text3:"solution"},
    {text4:"for you webs"}
]


function MainCont() {
  return (
    <section className="main__cont">
        <Info 
            text1={textInfor.text1}
            text2={textInfor.text2}
            text3={textInfor.text3}
            text4={textInfor.text4}
        />
    </section>
  )
}

export default MainCont
